  const arr = [ <Ai />,
  <User />, <Ai />,
  <User /> ]



  return ( 
    <div  className='flex flex-col mt-5'>
      <Ai />
      <User />

      { arr.map(( index) => (
        <div key={index}>   </div>
      ))}



    </div>
  )
}

export default ContainerMsg
